import React from 'react';
import Header from './jsx/header/header';
import FeaturedArticles from './jsx/featured/FeaturedArticles';
import forYou from './jsx/home_page/grid/forYou/f'
import Latestgrid from './jsx/home_page/grid/latest'
import LatestNews from './jsx/latest/LatestNews';
import Footer from './jsx/footer/Footer';
import './App.css'; // Main CSS file for the entire app
import AdBanner from './jsx/AdBanner/AdBanner';
import Navigation from './jsx/nav/Navigation';

const App = () => {
  return (
    <div className="apps">
      <AdBanner />
      <Header />
      <Navigation />
      <div className="app">
      <main className="main-content">

        <div className='grid'>
        <FeaturedArticles />
        <forYou />
        <Latestgrid />
        </div>
        <LatestNews />
      </main>
      </div>
      <Footer />
    </div>
  );
};

export default App;
